{'publishedAt': '2023-06-06T21:56:16Z', 'channelId': 'UCAGHY76tgzPiiXpJtM1sVCg', 'title': 'O CONGRESSO PRECISA DAR UM BASTA NESSA SUBSERVIÊNCIA PERANTE OS OUTROS DOIS PODERES!', 'description': 'Estamos vendo de maneira reiterada o Judiciário e o Executivo passarem por cima da Casa do Povo, e quando fazem isso, não estão passando por cima somente de Deputados e Senadores, estão passando por cima de VOCÊ que elegeu um representante para votar e aprovar leis!

Vergonhosa a cassação ilegal de Deltan Dallagnol pelo TSE, que foi referendada hoje pela Mesa Diretora da Câmara dos Deputados.

Não podemos deixar os representantes do povo de mãos atadas!', 'thumbnails': {'default': {'url': 'https://i.ytimg.com/vi/yx_EG_nb530/default.jpg', 'width': 120, 'height': 90}, 'medium': {'url': 'https://i.ytimg.com/vi/yx_EG_nb530/mqdefault.jpg', 'width': 320, 'height': 180}, 'high': {'url': 'https://i.ytimg.com/vi/yx_EG_nb530/hqdefault.jpg', 'width': 480, 'height': 360}, 'standard': {'url': 'https://i.ytimg.com/vi/yx_EG_nb530/sddefault.jpg', 'width': 640, 'height': 480}, 'maxres': {'url': 'https://i.ytimg.com/vi/yx_EG_nb530/maxresdefault.jpg', 'width': 1280, 'height': 720}}, 'channelTitle': 'Marcel van Hattem', 'playlistId': 'UUAGHY76tgzPiiXpJtM1sVCg', 'position': 1, 'resourceId': {'kind': 'youtube#video', 'videoId': 'yx_EG_nb530'}, 'videoOwnerChannelTitle': 'Marcel van Hattem', 'videoOwnerChannelId': 'UCAGHY76tgzPiiXpJtM1sVCg'}

{'publishedAt': '2023-06-01T00:58:44Z', 'channelId': 'UCAGHY76tgzPiiXpJtM1sVCg', 'title': 'PALHAÇADA E DESRESPEITO NA CÂMARA DOS DEPUTADOS', 'description': 'A realidade do dia a dia no plenário da Câmara dos Deputados é de um deboche e desrespeito à população brasileira, que escolheu mais de 500 parlamentares que vêm sendo feitos de palhaços. A sessão de hoje foi aberta às 9h 55min da manhã e até às 20h 21min não se sabia sequer se as votações pautadas iriam ou não ocorrer. 

O motivo? Negociatas a portas fechadas para que os líderes partidários decidissem em nome de centenas de parlamentares se a medida provisória do Lula para criação de novos ministérios seria ou não votada. Falam por aí que está em jogo a liberação de R$ 1,7 bilhão em emendas parlamentares. 

Devemos enterrar essa medida provisória para dizer ao povo brasileiro que cada deputado é independente e merece respeito. Não às negociatas!', 'thumbnails': {'default': {'url': 'https://i.ytimg.com/vi/36D9TDaaiig/default.jpg', 'width': 120, 'height': 90}, 'medium': {'url': 'https://i.ytimg.com/vi/36D9TDaaiig/mqdefault.jpg', 'width': 320, 'height': 180}, 'high': {'url': 'https://i.ytimg.com/vi/36D9TDaaiig/hqdefault.jpg', 'width': 480, 'height': 360}, 'standard': {'url': 'https://i.ytimg.com/vi/36D9TDaaiig/sddefault.jpg', 'width': 640, 'height': 480}, 'maxres': {'url': 'https://i.ytimg.com/vi/36D9TDaaiig/maxresdefault.jpg', 'width': 1280, 'height': 720}}, 'channelTitle': 'Marcel van Hattem', 'playlistId': 'UUAGHY76tgzPiiXpJtM1sVCg', 'position': 12, 'resourceId': {'kind': 'youtube#video', 'videoId': '36D9TDaaiig'}, 'videoOwnerChannelTitle': 'Marcel van Hattem', 'videoOwnerChannelId': 'UCAGHY76tgzPiiXpJtM1sVCg'}

{'publishedAt': '2023-05-30T21:03:34Z', 'channelId': 'UCAGHY76tgzPiiXpJtM1sVCg', 'title': 'O BRASIL PRECISA DE MAIS JURISTAS COMO IVES GANDRA', 'description': 'Há pouco participei de audiência pública na Câmara dos Deputados sobre as decisões dos tribunais eleitorais, muitas eivadas de irregularidades, e pude elogiar pessoalmente o jurista Ives Gandra - um dos poucos nomes do direito brasileiro que tem vindo a publico em defesa do Estado de Direito e da nossa Constituição. 

É frustrante e provoca indignação este silêncio que tem imperado justamente dentre aqueles que deveriam se voltar contra decisões que não têm mais nada de jurídicas e passaram a ser políticas. O que o TSE fez contra Deltan Dallagnol e seus quase 350 mil eleitores é de uma ilegalidade e inconstitucionalidade sem tamanho. 

Como falei ao doutor Ives Gandra, espero que muitos outros adotem sua postura e que juntem-se a nós o mais rapidamente possível contra todo e qualquer tipo de arbítrio no nosso país.', 'thumbnails': {'default': {'url': 'https://i.ytimg.com/vi/WXgkiupKKVQ/default.jpg', 'width': 120, 'height': 90}, 'medium': {'url': 'https://i.ytimg.com/vi/WXgkiupKKVQ/mqdefault.jpg', 'width': 320, 'height': 180}, 'high': {'url': 'https://i.ytimg.com/vi/WXgkiupKKVQ/hqdefault.jpg', 'width': 480, 'height': 360}, 'standard': {'url': 'https://i.ytimg.com/vi/WXgkiupKKVQ/sddefault.jpg', 'width': 640, 'height': 480}, 'maxres': {'url': 'https://i.ytimg.com/vi/WXgkiupKKVQ/maxresdefault.jpg', 'width': 1280, 'height': 720}}, 'channelTitle': 'Marcel van Hattem', 'playlistId': 'UUAGHY76tgzPiiXpJtM1sVCg', 'position': 16, 'resourceId': {'kind': 'youtube#video', 'videoId': 'WXgkiupKKVQ'}, 'videoOwnerChannelTitle': 'Marcel van Hattem', 'videoOwnerChannelId': 'UCAGHY76tgzPiiXpJtM1sVCg'}

{'publishedAt': '2023-05-27T02:12:08Z', 'channelId': 'UCAGHY76tgzPiiXpJtM1sVCg', 'title': 'NÃO PODEMOS FICAR CALADOS DIANTE DO QUE OCORRE NO BRASIL', 'description': 'Não dá mais! O Brasil precisa demonstrar que não concorda com os abusos que estão ocorrendo no país. Por isso é tão importante que a população vá às ruas em defesa da democracia, da liberdade e da justiça. 

Deltan Dallganol foi cassado de forma ilegal, o presidente da CPI do MST, deputado Tenente-Coronel Zucco, e o autor do pedido da CPMI de 8 de janeiro, deputado André Fernandes, são alvos de inquéritos conduzidos por Alexandre de Moraes. Centenas estão presos injustamente, Daniel Silveira está preso por crime de opinião mesmo após indulto. Tudo absurdo!

Como disse há pouco no programa Oeste Sem Filtro, não há coincidência em política. Não podemos correr o risco de que mais deputados sejam cassados, que os votos dos brasileiros sejam colocados no lixo. A importância do apoio da população nas ruas é cada vez mais importante - sem isso, vamos apenas perder direitos e liberdades mais rapidamente, a cada dia que passa.', 'thumbnails': {'default': {'url': 'https://i.ytimg.com/vi/2vGGn56IboY/default.jpg', 'width': 120, 'height': 90}, 'medium': {'url': 'https://i.ytimg.com/vi/2vGGn56IboY/mqdefault.jpg', 'width': 320, 'height': 180}, 'high': {'url': 'https://i.ytimg.com/vi/2vGGn56IboY/hqdefault.jpg', 'width': 480, 'height': 360}, 'standard': {'url': 'https://i.ytimg.com/vi/2vGGn56IboY/sddefault.jpg', 'width': 640, 'height': 480}, 'maxres': {'url': 'https://i.ytimg.com/vi/2vGGn56IboY/maxresdefault.jpg', 'width': 1280, 'height': 720}}, 'channelTitle': 'Marcel van Hattem', 'playlistId': 'UUAGHY76tgzPiiXpJtM1sVCg', 'position': 20, 'resourceId': {'kind': 'youtube#video', 'videoId': '2vGGn56IboY'}, 'videoOwnerChannelTitle': 'Marcel van Hattem', 'videoOwnerChannelId': 'UCAGHY76tgzPiiXpJtM1sVCg'}

{'publishedAt': '2023-05-24T12:37:28Z', 'channelId': 'UCAGHY76tgzPiiXpJtM1sVCg', 'title': 'CÂMARA SE APEQUENA CADA DIA MAIS SOB A GESTÃO DE ARTHUR LIRA', 'description': 'É lamentável que a Mesa Diretora da Câmara dos Deputados esteja em SILÊNCIO sobre a cassação ilegal e inconstitucional do deputado Deltan Dallagnol. Lamentável também a agilidade que deram ao processo contra Deltan, enquanto outros tantos casos, esses sim com graves problemas na justiça, são protelados indefinidamente. Essas atitudes são um reflexo claro do quanto a Câmara se apequenou desde que Arthur Lira assumiu a presidência. 

Lira se curvou diante do Judiciário quando prenderam um deputado federal, quando da questão do voto impresso, quando da censura constante contra parlamentares e, agora, contra Deltan. A Mesa Diretora precisa defender seus parlamentares contra o abuso e o arbítrio de outros Poderes, mas o que estamos vendo é a Câmara cada cada vez mais subjugada ao Poder Judiciário. 

Lira deveria prestar mais atenção ao que o cidadão brasileiro quer, pois o povo tem ido às ruas e demonstrado que não aceitará viver em um país sem democracia, sem liberdade e sem justiça.', 'thumbnails': {'default': {'url': 'https://i.ytimg.com/vi/PGaokGrmraI/default.jpg', 'width': 120, 'height': 90}, 'medium': {'url': 'https://i.ytimg.com/vi/PGaokGrmraI/mqdefault.jpg', 'width': 320, 'height': 180}, 'high': {'url': 'https://i.ytimg.com/vi/PGaokGrmraI/hqdefault.jpg', 'width': 480, 'height': 360}, 'standard': {'url': 'https://i.ytimg.com/vi/PGaokGrmraI/sddefault.jpg', 'width': 640, 'height': 480}, 'maxres': {'url': 'https://i.ytimg.com/vi/PGaokGrmraI/maxresdefault.jpg', 'width': 1280, 'height': 720}}, 'channelTitle': 'Marcel van Hattem', 'playlistId': 'UUAGHY76tgzPiiXpJtM1sVCg', 'position': 26, 'resourceId': {'kind': 'youtube#video', 'videoId': 'PGaokGrmraI'}, 'videoOwnerChannelTitle': 'Marcel van Hattem', 'videoOwnerChannelId': 'UCAGHY76tgzPiiXpJtM1sVCg'}

{'publishedAt': '2023-05-14T21:14:08Z', 'channelId': 'UCAGHY76tgzPiiXpJtM1sVCg', 'title': 'CAFÉ COM O PRIMEIRO-MINISTRO HOLANDÊS', 'description': 'Nessa terça-feira tive uma oportunidade muito especial: encontrei-me em Brasília com o primeiro-ministro holandês Mark Rutte durante sua visita oficial ao nosso país, que incluiu também passagens por São Paulo e Ceará. Pudemos conversar durante um café na Asa Norte da capital federal sobre muitas coisas que aproximam Brasil e Holanda: temos muita história em comum e, hoje, os dois países mantêm intenso intercâmbio econômico.

Conversamos em holandês, idioma que aprendi em casa com meu pai e minha avó conforme expliquei ao Premiê pois, meu avô paterno veio com esposa e filhos da Holanda ao Brasil nos anos 1960 para servir como pastor na colônia holandesa em Carambeí, Paraná. Contei-lhe também minha visão sobre a situação política brasileira atual e lhe entreguei vários pronunciamentos e artigos meus descrevendo o momento que vivemos no Brasil.

Ao final do nosso encontro, presenteei Rutte com livros de fotos do Congresso e da minha cidade de Dois Irmãos, um vinho da Serra Gaúcha e com uma cuia e bomba de chimarrão, convidando-o também a conhecer o Rio Grande do Sul numa próxima vinda ao Brasil. Muito simpático e atencioso, retribuiu-me com tradicionais stroopwafels e um forte aperto de mão: que as relações entre Brasil e Holanda sejam cada vez mais fortes e proveitosas para ambos os países!', 'thumbnails': {'default': {'url': 'https://i.ytimg.com/vi/W2vzX7Oh7Vs/default.jpg', 'width': 120, 'height': 90}, 'medium': {'url': 'https://i.ytimg.com/vi/W2vzX7Oh7Vs/mqdefault.jpg', 'width': 320, 'height': 180}, 'high': {'url': 'https://i.ytimg.com/vi/W2vzX7Oh7Vs/hqdefault.jpg', 'width': 480, 'height': 360}, 'standard': {'url': 'https://i.ytimg.com/vi/W2vzX7Oh7Vs/sddefault.jpg', 'width': 640, 'height': 480}, 'maxres': {'url': 'https://i.ytimg.com/vi/W2vzX7Oh7Vs/maxresdefault.jpg', 'width': 1280, 'height': 720}}, 'channelTitle': 'Marcel van Hattem', 'playlistId': 'UUAGHY76tgzPiiXpJtM1sVCg', 'position': 38, 'resourceId': {'kind': 'youtube#video', 'videoId': 'W2vzX7Oh7Vs'}, 'videoOwnerChannelTitle': 'Marcel van Hattem', 'videoOwnerChannelId': 'UCAGHY76tgzPiiXpJtM1sVCg'}

{'publishedAt': '2023-05-11T00:38:58Z', 'channelId': 'UCAGHY76tgzPiiXpJtM1sVCg', 'title': 'CONSELHO NACIONAL DE JUSTIÇA TEM DADO MOTIVOS PARA SER EXTINTO NÃO PARA SER PREMIADO', 'description': 'Uma vergonha o que ocorreu hoje no plenário da Câmara dos Deputados com a aprovação do projeto que cria mais cargos em comissão para o Conselho Nacional de Justiça. O Parlamento premiou o CNJ justamente em um momento em que o Conselho tem é dado motivos para ser extinto. 

O STF tem sido protagonista de ataques à democracia e com total desrespeito à dignidade da pessoa humana e o CNJ nada faz! 

Infelizmente, hoje, a Câmara dos Deputados recompensou a incompetência do CNJ.', 'thumbnails': {'default': {'url': 'https://i.ytimg.com/vi/0qj4ygvjAfU/default.jpg', 'width': 120, 'height': 90}, 'medium': {'url': 'https://i.ytimg.com/vi/0qj4ygvjAfU/mqdefault.jpg', 'width': 320, 'height': 180}, 'high': {'url': 'https://i.ytimg.com/vi/0qj4ygvjAfU/hqdefault.jpg', 'width': 480, 'height': 360}, 'standard': {'url': 'https://i.ytimg.com/vi/0qj4ygvjAfU/sddefault.jpg', 'width': 640, 'height': 480}, 'maxres': {'url': 'https://i.ytimg.com/vi/0qj4ygvjAfU/maxresdefault.jpg', 'width': 1280, 'height': 720}}, 'channelTitle': 'Marcel van Hattem', 'playlistId': 'UUAGHY76tgzPiiXpJtM1sVCg', 'position': 41, 'resourceId': {'kind': 'youtube#video', 'videoId': '0qj4ygvjAfU'}, 'videoOwnerChannelTitle': 'Marcel van Hattem', 'videoOwnerChannelId': 'UCAGHY76tgzPiiXpJtM1sVCg'}

{'publishedAt': '2023-05-09T01:10:53Z', 'channelId': 'UCAGHY76tgzPiiXpJtM1sVCg', 'title': 'PRECISAMOS DE MANIFESTAÇÕES CONTRA A DITADURA QUE QUEREM NOS IMPOR!', 'description': 'O judiciário precisa respeitar os limites constitucionais e parar de agir como legislador, não aceitaremos nenhum tipo de CENSURA independente da onde venha.

#NãoaoPLdaCensura #NãoaoPL2630 #Democracia #Direita #Liberdade

Marcel van Hattem I Lucas Pavanato', 'thumbnails': {'default': {'url': 'https://i.ytimg.com/vi/gNixKBcLHVM/default.jpg', 'width': 120, 'height': 90}, 'medium': {'url': 'https://i.ytimg.com/vi/gNixKBcLHVM/mqdefault.jpg', 'width': 320, 'height': 180}, 'high': {'url': 'https://i.ytimg.com/vi/gNixKBcLHVM/hqdefault.jpg', 'width': 480, 'height': 360}, 'standard': {'url': 'https://i.ytimg.com/vi/gNixKBcLHVM/sddefault.jpg', 'width': 640, 'height': 480}, 'maxres': {'url': 'https://i.ytimg.com/vi/gNixKBcLHVM/maxresdefault.jpg', 'width': 1280, 'height': 720}}, 'channelTitle': 'Marcel van Hattem', 'playlistId': 'UUAGHY76tgzPiiXpJtM1sVCg', 'position': 45, 'resourceId': {'kind': 'youtube#video', 'videoId': 'gNixKBcLHVM'}, 'videoOwnerChannelTitle': 'Marcel van Hattem', 'videoOwnerChannelId': 'UCAGHY76tgzPiiXpJtM1sVCg'}

{'publishedAt': '2023-05-06T14:13:24Z', 'channelId': 'UCAGHY76tgzPiiXpJtM1sVCg', 'title': 'ESPETÁCULO SOM E LUZ EM SÃO MIGUEL DAS MISSÕES TERÁ NOVAS ARQUIBANCADAS', 'description': 'O projeto da prefeitura de São Miguel das Missões para a revitalização completa da arquibancada do Espetáculo Som e Luz foi selecionado em edital promovido pelo nosso gabinete para a destinação de R$ 250 mil em emenda parlamentar. Fizemos o anúncio nessa sexta, durante o Encontro Nacional das Cidades Patrimônio Mundial.

As ruínas de São Miguel são consideradas patrimônio da humanidade e fico muito feliz em poder contribuir para que um espetáculo tão único, como o Som e Luz - que pudemos conhecer ainda crianças -, receba este investimento.

Agradecemos ao prefeito José Roberto e aos moradores que nos receberam tão bem, assim como parabenizamos a equipe da prefeitura pela qualidade do projeto apresentado. O RS tem muitos destinos turísticos que merecem ser conhecidos e investir na infraestrutura deles é fundamental para atrair mais visitantes!', 'thumbnails': {'default': {'url': 'https://i.ytimg.com/vi/eoq3f7VSWME/default.jpg', 'width': 120, 'height': 90}, 'medium': {'url': 'https://i.ytimg.com/vi/eoq3f7VSWME/mqdefault.jpg', 'width': 320, 'height': 180}, 'high': {'url': 'https://i.ytimg.com/vi/eoq3f7VSWME/hqdefault.jpg', 'width': 480, 'height': 360}, 'standard': {'url': 'https://i.ytimg.com/vi/eoq3f7VSWME/sddefault.jpg', 'width': 640, 'height': 480}, 'maxres': {'url': 'https://i.ytimg.com/vi/eoq3f7VSWME/maxresdefault.jpg', 'width': 1280, 'height': 720}}, 'channelTitle': 'Marcel van Hattem', 'playlistId': 'UUAGHY76tgzPiiXpJtM1sVCg', 'position': 50, 'resourceId': {'kind': 'youtube#video', 'videoId': 'eoq3f7VSWME'}, 'videoOwnerChannelTitle': 'Marcel van Hattem', 'videoOwnerChannelId': 'UCAGHY76tgzPiiXpJtM1sVCg'}

{'publishedAt': '2023-05-06T14:12:30Z', 'channelId': 'UCAGHY76tgzPiiXpJtM1sVCg', 'title': 'PRECISAMOS DEBATER AS ILEGALIDADES COMETIDAS CONTRA OS PRESOS DE 8 DE JANEIRO', 'description': 'Não é possível que o Parlamento vire as costas para a gravidade do que está ocorrendo com os presos de 8 de janeiro, que estão sendo vítimas de abuso de autoridade e têm seu direito ao devido processo legal violado constantemente. Por isso, a Comissão de Segurança da Câmara dos Deputados aprovou requerimento de minha autoria para a realização de audiência pública para debater o tema.  

Quero deixar bem claro que ninguém está pensando em “passar pano” para os verdadeiros culpados dos atos bárbaros que presenciamos em 8 de janeiro, a investigação deve ser feita e os verdadeiros culpados punidos, seja quem for. O inadmissível é a perseguição política e o desrespeito às leis. 

Entre os convidados da audiência pública estão a OAB Nacional; o diretor-geral da Polícia Federal, Andrei Augusto Passos Rodrigues; o Ministro dos Direitos Humanos, Silvio Almeida; e o ministro Alexandre de Moraes. Todos têm muito a explicar à população brasileira sobre essa série de arbitrariedades. A data da audiência ainda será definida.', 'thumbnails': {'default': {'url': 'https://i.ytimg.com/vi/i6rkVa8xReA/default.jpg', 'width': 120, 'height': 90}, 'medium': {'url': 'https://i.ytimg.com/vi/i6rkVa8xReA/mqdefault.jpg', 'width': 320, 'height': 180}, 'high': {'url': 'https://i.ytimg.com/vi/i6rkVa8xReA/hqdefault.jpg', 'width': 480, 'height': 360}, 'standard': {'url': 'https://i.ytimg.com/vi/i6rkVa8xReA/sddefault.jpg', 'width': 640, 'height': 480}, 'maxres': {'url': 'https://i.ytimg.com/vi/i6rkVa8xReA/maxresdefault.jpg', 'width': 1280, 'height': 720}}, 'channelTitle': 'Marcel van Hattem', 'playlistId': 'UUAGHY76tgzPiiXpJtM1sVCg', 'position': 51, 'resourceId': {'kind': 'youtube#video', 'videoId': 'i6rkVa8xReA'}, 'videoOwnerChannelTitle': 'Marcel van Hattem', 'videoOwnerChannelId': 'UCAGHY76tgzPiiXpJtM1sVCg'}

{'publishedAt': '2023-04-28T15:43:28Z', 'channelId': 'UCAGHY76tgzPiiXpJtM1sVCg', 'title': 'GOVERNO LULA DESRESPEITA O PARLAMENTO BRASILEIRO!', 'description': 'Infelizmente, não tem como ser diferente e as Comissões da Câmara dos Deputados precisam partir para a convocação dos ministros de Lula para prestar esclarecimentos. O acordo de cavalheiros que sempre foi respeitado pelos governos anteriores, quando se faz um convite e o ministro se compromete a comparecer, não está funcionando com o PT. Por vezes quebram sua palavra ou quando aparecem, se acham no direito de tentar debochar dos parlamentares como foi a risível participação de Flávio Dino na Comissão de Segurança. 

Agora, vamos convocar o ministro Ricardo Capelli, que mesmo tendo assumido interinamente o GSI já demonstra que está profundamente comprometido com a depredação ocorrida dentro do Palácio do Planalto. Suas manifestações e tweets não deixam dúvidas sobre isso. 

Capelli tem muito a explicar, não apenas para o Parlamento, mas principalmente ao cidadão brasileiro que tem o direito de saber o que realmente ocorreu no dia 8 de janeiro.', 'thumbnails': {'default': {'url': 'https://i.ytimg.com/vi/-TDYf6OLNrU/default.jpg', 'width': 120, 'height': 90}, 'medium': {'url': 'https://i.ytimg.com/vi/-TDYf6OLNrU/mqdefault.jpg', 'width': 320, 'height': 180}, 'high': {'url': 'https://i.ytimg.com/vi/-TDYf6OLNrU/hqdefault.jpg', 'width': 480, 'height': 360}, 'standard': {'url': 'https://i.ytimg.com/vi/-TDYf6OLNrU/sddefault.jpg', 'width': 640, 'height': 480}, 'maxres': {'url': 'https://i.ytimg.com/vi/-TDYf6OLNrU/maxresdefault.jpg', 'width': 1280, 'height': 720}}, 'channelTitle': 'Marcel van Hattem', 'playlistId': 'UUAGHY76tgzPiiXpJtM1sVCg', 'position': 65, 'resourceId': {'kind': 'youtube#video', 'videoId': '-TDYf6OLNrU'}, 'videoOwnerChannelTitle': 'Marcel van Hattem', 'videoOwnerChannelId': 'UCAGHY76tgzPiiXpJtM1sVCg'}

{'publishedAt': '2023-04-25T17:03:23Z', 'channelId': 'UCAGHY76tgzPiiXpJtM1sVCg', 'title': 'JÁ IMPEACHMENT DO LULA EM PORTUGAL!', 'description': 'Os escândalos de corrupção protagonizados por Lula e pelo PT são de conhecimento do mundo todo, não tem nem como esconder. Com cartazes de “tolerância zero à corrupção” e “lugar de ladrão é na prisão”, manifestantes portugueses protestaram contra Lula em frente ao Parlamento de Portugal com frases como “Lula ladrão, seu lugar é na prisão”. 

O protesto também ocorreu dentro do Parlamento, com deputados exibindo cartazes com a frase “chega de corrupção” durante discurso do petista. 

Já é impeachment do Lula em Portugal! Tenho certeza de que logo também será no Brasil.', 'thumbnails': {'default': {'url': 'https://i.ytimg.com/vi/Df4rcyT702E/default.jpg', 'width': 120, 'height': 90}, 'medium': {'url': 'https://i.ytimg.com/vi/Df4rcyT702E/mqdefault.jpg', 'width': 320, 'height': 180}, 'high': {'url': 'https://i.ytimg.com/vi/Df4rcyT702E/hqdefault.jpg', 'width': 480, 'height': 360}, 'standard': {'url': 'https://i.ytimg.com/vi/Df4rcyT702E/sddefault.jpg', 'width': 640, 'height': 480}, 'maxres': {'url': 'https://i.ytimg.com/vi/Df4rcyT702E/maxresdefault.jpg', 'width': 1280, 'height': 720}}, 'channelTitle': 'Marcel van Hattem', 'playlistId': 'UUAGHY76tgzPiiXpJtM1sVCg', 'position': 69, 'resourceId': {'kind': 'youtube#video', 'videoId': 'Df4rcyT702E'}, 'videoOwnerChannelTitle': 'Marcel van Hattem', 'videoOwnerChannelId': 'UCAGHY76tgzPiiXpJtM1sVCg'}

{'publishedAt': '2023-04-21T22:16:18Z', 'channelId': 'UCAGHY76tgzPiiXpJtM1sVCg', 'title': 'BARRAR PRIVATIZAÇÕES É MAIS UM RETROCESSO DO DESGOVERNO LULA', 'description': 'Impedir as privatizações de estatais é um grave erro e retrocesso do governo petista. Mas o que esperar de Lula e do PT que tanto se esbaldaram em corrupções envolvendo empresas públicas? Infelizmente, nada! Além da roubalheira, o PT não soube administrar as estatais. Na época de Dilma, o rombo chegou a mais de R$ 70 bilhões. 

No governo passado, já com a Lei das Estatais em vigor, as mesmas empresas registraram lucro de R$ 200 bilhões. A situação tende a piorar, pois o governo Lula vem desrespeitando sucessivamente a legislação, inclusive, com aval do Supremo que considerou ilegal trechos da lei. 

