{'publishedAt': '2023-02-28T16:04:00Z', 'channelId': 'UCAGHY76tgzPiiXpJtM1sVCg', 'title': 'A REFORMA TRIBUTÁRIA NÃO PODE SER UM RETROCESSO', 'description': 'A Câmara dos Deputados infelizmente começou mal no assunto e não está tratando a reforma tributária com a seriedade necessária. O grupo de trabalho criado para discutir a reforma contará, pasme, com apenas 12 deputados! Isso não representa nem 2% do Parlamento... 

