{'publishedAt': '2023-02-03T22:00:53Z', 'channelId': 'UCAGHY76tgzPiiXpJtM1sVCg', 'title': 'SEREI OPOSIÇÃO FIRME, COERENTE E COMPROMETIDA COM O PAÍS', 'description': 'O que está acontecendo no nosso país é preocupante: o Congresso está se sujeitando a um período de exceção institucional, de ruptura do Estado de Direito. O tensionamento causado pelos constantes abusos de poder está levando o país a uma verdadeira convulsão social. Não podemos permitir que cenas como as vistas em Brasília, em que um homem ateou fogo no próprio corpo em protesto aos desmandos do STF, se repitam.  

