{'publishedAt': '2023-01-29T21:00:03Z', 'channelId': 'UCAGHY76tgzPiiXpJtM1sVCg', 'title': '“EXISTE UMA TENDÊNCIA DE QUE O SENHOR LANCE O SEU NOME À PRESIDÊNCIA DA CÂMARA?”', 'description': 'Já passou da hora de o Parlamento brasileiro retomar o espaço que lhe cabe de acordo com a nossa Constituição: não podemos mais ser subjugados por outros Poderes, principalmente pelo Judiciário! Temos uma nova chance de começar a mudar essa situação na próxima quarta-feira, quando ocorre a eleição para a presidência tanto do Senado como da Câmara dos Deputados. 

