Não deixe de cobrar de seu deputado e de seu senador nessas eleições tão importantes. A atuação do Parlamento pode melhorar com a sua ajuda, com a eleição de presidentes que realmente atuem a partir da nossa prerrogativa, que é representar a população. Tenho sido, inclusive, procurado por colegas parlamentares sobre a possibilidade de concorrer neste ano novamente à presidência da Câmara pois, até o momento, apenas o atual presidente Arthur Lira (PP), apoiado por Lula, e Chico Alencar, da extrema-esquerda do PSOL, anunciaram candidatura. Estou ouvindo muita gente para tomar uma decisão em breve a este respeito. Falei sobre esse assunto em entrevista ao programa CNN 360 com Muriel Porfírio e Larissa Rodrigues.', 'thumbnails': {'default': {'url': 'https://i.ytimg.com/vi/K8E8KqmfHwc/default.jpg', 'width': 120, 'height': 90}, 'medium': {'url': 'https://i.ytimg.com/vi/K8E8KqmfHwc/mqdefault.jpg', 'width': 320, 'height': 180}, 'high': {'url': 'https://i.ytimg.com/vi/K8E8KqmfHwc/hqdefault.jpg', 'width': 480, 'height': 360}, 'standard': {'url': 'https://i.ytimg.com/vi/K8E8KqmfHwc/sddefault.jpg', 'width': 640, 'height': 480}, 'maxres': {'url': 'https://i.ytimg.com/vi/K8E8KqmfHwc/maxresdefault.jpg', 'width': 1280, 'height': 720}}, 'channelTitle': 'Marcel van Hattem', 'playlistId': 'UUAGHY76tgzPiiXpJtM1sVCg', 'position': 161, 'resourceId': {'kind': 'youtube#video', 'videoId': 'K8E8KqmfHwc'}, 'videoOwnerChannelTitle': 'Marcel van Hattem', 'videoOwnerChannelId': 'UCAGHY76tgzPiiXpJtM1sVCg'}

