{'publishedAt': '2023-01-16T00:55:45Z', 'channelId': 'UCAGHY76tgzPiiXpJtM1sVCg', 'title': 'LULA IS EEN CRIMINEEL', 'description': 'Além do Jornal De Telegraaf, também a televisão holandesa me procurou para falar sobre a situação no Brasil. Foi na última segunda-feira (10), no dia seguinte às violentas e lamentáveis invasões aos prédios dos Três Poderes. Eu estava naquele dia visitando familiares na Antuérpia (Bélgica) e de lá gravei essa entrevista ao principal programa de aprofundamento das notícias do dia na TV Holandesa, o Één Vandaag.

Para mim foi curioso dar entrevista a esse programa específico, pois muito o assistia em casa, em Utrecht, no início da noite quando voltava das aulas do meu mestrado em Ciência Política na Universidade de Leiden, concluído em 2012. Agora como entrevistado, repudiei os atos violentos em Brasília de domingo passado, além de ter também contextualizado ao repórter Marc Belinfante a situação política no Brasil que, infelizmente, a maior parte da mídia europeia e internacional não divulga: Lula teve seus processos anulados pelo STF, mas o fato de ter sido condenado como criminoso (ou, crimineel, em holandês) e depois ser eleito presidente da República revolta uma massa ENORME de brasileiros. Falei também da censura que atualmente está sendo imposta a diversos políticos e cidadãos brasileiros pela Suprema Corte, algo impensável num país como a Holanda onde a liberdade de expressão e o devido processo são basilares. É fundamental que o mundo saiba o absurdo que se passa no nosso Brasil!

Assista à entrevista e não se assuste: estou falando em holandês mesmo, idioma que aprendi ainda pequeno. Sempre falei em holandês com meu pai, que nasceu na cidade de Scheemda, Holanda, e veio para o Brasil com seus pais quando tinha apenas 7 anos. Por esse motivo mantenho ainda fortes vínculos com os Países Baixos, onde já morei, estudei e empreendi antes de retornar ao Brasil e à política em 2013.', 'thumbnails': {'default': {'url': 'https://i.ytimg.com/vi/3rpMt5cPGR4/default.jpg', 'width': 120, 'height': 90}, 'medium': {'url': 'https://i.ytimg.com/vi/3rpMt5cPGR4/mqdefault.jpg', 'width': 320, 'height': 180}, 'high': {'url': 'https://i.ytimg.com/vi/3rpMt5cPGR4/hqdefault.jpg', 'width': 480, 'height': 360}, 'standard': {'url': 'https://i.ytimg.com/vi/3rpMt5cPGR4/sddefault.jpg', 'width': 640, 'height': 480}, 'maxres': {'url': 'https://i.ytimg.com/vi/3rpMt5cPGR4/maxresdefault.jpg', 'width': 1280, 'height': 720}}, 'channelTitle': 'Marcel van Hattem', 'playlistId': 'UUAGHY76tgzPiiXpJtM1sVCg', 'position': 165, 'resourceId': {'kind': 'youtube#video', 'videoId': '3rpMt5cPGR4'}, 'videoOwnerChannelTitle': 'Marcel van Hattem', 'videoOwnerChannelId': 'UCAGHY76tgzPiiXpJtM1sVCg'}

{'publishedAt': '2022-12-28T21:01:36Z', 'channelId': 'UCAGHY76tgzPiiXpJtM1sVCg', 'title': 'IR A NOVA YORK FALAR DE DEMOCRACIA É FÁCIL! QUERO VER CRUZAR A RUA E IR AO CONGRESSO', 'description': 'Aprovamos na Comissão de Segurança Pública, no dia 13, convite para que Alexandre de Moraes preste esclarecimentos a respeito da censura imposta a parlamentares nas redes sociais. Como eu disse na reunião, porém, sabíamos que, infelizmente, Moraes não compareceria - já estamos no recesso e nem resposta foi dada ao ofício aprovado pela Comissão. Fica claro que para ministros do STF é mais fácil ir a Nova York fazer proselitismo político do que atravessar a rua para tratar da democracia onde realmente é seu lugar: na Casa do Povo.

