{'publishedAt': '2022-12-24T01:33:30Z', 'channelId': 'UCAGHY76tgzPiiXpJtM1sVCg', 'title': 'NÃO DESISTIREI! CPI DEVE SER PRIORIDADE DO NOVO CONGRESSO!', 'description': 'A CPI para investigar os abusos de autoridade  do TSE e STF, acabou não sendo instalada nesta legislatura. A desculpa? Uma fila de 8 CPIs à frente, a maioria de 2019, que sequer foram despachadas pela Mesa. O poder de investigar da minoria parlamentar foi cerceado nestes 4 anos! 

Eu, porém, não desistirei: as atuais CPIs serão todas arquivadas e correremos na frente para que a CPI do Abuso de Autoridade do STF e do TSE seja a primeira da fila na nova legislatura. Melhor ainda: senadores também estão se movimentando para fazermos uma CPMI - ou seja, uma Comissão Parlamentar MISTA de Inquérito, com deputados e senadores, cuja instalação é automática.

A população e o Estado de Direito clamam para que o Congresso cumpra seu papel Constitucional e restabeleça o equilíbrio entre os Poderes. Os abusos e arbitrariedades não podem continuar e os que ocorreram precisam ser investigados e responsabilizados. Seguirei fazendo meu trabalho, inclusive no recesso e estou certo de que contarei novamente com seu apoio na coleta de assinaturas para o novo mandato. Muito obrigado a todos pelo apoio e vamos redobrar os esforços: a CPI do Abuso de Autoridade do STF e do TSE precisam ser prioridade total do novo Congresso!', 'thumbnails': {'default': {'url': 'https://i.ytimg.com/vi/4spNuTHCXm4/default.jpg', 'width': 120, 'height': 90}, 'medium': {'url': 'https://i.ytimg.com/vi/4spNuTHCXm4/mqdefault.jpg', 'width': 320, 'height': 180}, 'high': {'url': 'https://i.ytimg.com/vi/4spNuTHCXm4/hqdefault.jpg', 'width': 480, 'height': 360}, 'standard': {'url': 'https://i.ytimg.com/vi/4spNuTHCXm4/sddefault.jpg', 'width': 640, 'height': 480}, 'maxres': {'url': 'https://i.ytimg.com/vi/4spNuTHCXm4/maxresdefault.jpg', 'width': 1280, 'height': 720}}, 'channelTitle': 'Marcel van Hattem', 'playlistId': 'UUAGHY76tgzPiiXpJtM1sVCg', 'position': 175, 'resourceId': {'kind': 'youtube#video', 'videoId': '4spNuTHCXm4'}, 'videoOwnerChannelTitle': 'Marcel van Hattem', 'videoOwnerChannelId': 'UCAGHY76tgzPiiXpJtM1sVCg'}

{'publishedAt': '2022-12-22T18:59:47Z', 'channelId': 'UCAGHY76tgzPiiXpJtM1sVCg', 'title': 'EU NUNCA VI TANTA GANÂNCIA NA MINHA VIDA COMO VEJO NO PARLAMENTO', 'description': 'O que presenciei nesta semana no Congresso é de uma vergonha indescritível: discursos falaciosos com a desculpa de ajudar os mais pobres quando o único objetivo é conseguir recursos para perpetuarem-se na política. Nunca vi tanta ganância na minha vida como vejo no Parlamento. 

Não era preciso votar a PEC do Lula após a decisão do ministro Gilmar Mendes (ilegal, é bom ressaltar) de retirar o Bolsa Família do teto de gastos. Como nunca se quis ajudar os mais pobres, a PEC foi votada e aprovada para abrir espaço fiscal para que a gastança irresponsável possa ser feita. Mesmo com as contas de 2022 fechadas, foram liberados recursos para pagar os “compromissos assumidos” com as emendas de relator neste ano. Lamento que o Congresso tenha aprovado um déficit primário para 2023 de R$ 232,6 bilhões. Um absurdo.  

O Parlamento está gerando inflação, aumentando os juros, gerando mais pobreza no Brasil e quem vai pagar a conta é justamente os mais pobres. Tudo isso em nome da ganância e ambição de grande parte do Parlamento que tem como foco usar o dinheiro do povo para se manter no poder, gerando dívidas que ficam sob responsabilidade da população pagar. Não compactuarei nunca com esse jeito perverso de fazer política, por isso votei contra a PEC do Lula e o Orçamento de 2023. Acompanhe minha fala na Comissão Mista de Orçamento na manhã desta quinta-feira (22).', 'thumbnails': {'default': {'url': 'https://i.ytimg.com/vi/SrgCFbCtXg8/default.jpg', 'width': 120, 'height': 90}, 'medium': {'url': 'https://i.ytimg.com/vi/SrgCFbCtXg8/mqdefault.jpg', 'width': 320, 'height': 180}, 'high': {'url': 'https://i.ytimg.com/vi/SrgCFbCtXg8/hqdefault.jpg', 'width': 480, 'height': 360}, 'standard': {'url': 'https://i.ytimg.com/vi/SrgCFbCtXg8/sddefault.jpg', 'width': 640, 'height': 480}, 'maxres': {'url': 'https://i.ytimg.com/vi/SrgCFbCtXg8/maxresdefault.jpg', 'width': 1280, 'height': 720}}, 'channelTitle': 'Marcel van Hattem', 'playlistId': 'UUAGHY76tgzPiiXpJtM1sVCg', 'position': 176, 'resourceId': {'kind': 'youtube#video', 'videoId': 'SrgCFbCtXg8'}, 'videoOwnerChannelTitle': 'Marcel van Hattem', 'videoOwnerChannelId': 'UCAGHY76tgzPiiXpJtM1sVCg'}

{'publishedAt': '2022-12-21T21:12:04Z', 'channelId': 'UCAGHY76tgzPiiXpJtM1sVCg', 'title': 'ROUBO! CONFISCO!', 'description': 'A PEC do Lula tem um artigo para autorizar o ROUBO de dinheiro dos trabalhadores. É isso mesmo! O texto determina que mais de R$ 24 bilhões em contas PIS/PASEP que não foram movimentados nos últimos 20 anos ou mais serão usados para gastos públicos se não reclamados em 60 dias após divulgados os nomes dos titulares no Diário Oficial. ISSO É CONFISCO! ROUBO! 

