{'publishedAt': '2022-12-20T16:16:15Z', 'channelId': 'UCAGHY76tgzPiiXpJtM1sVCg', 'title': '"O HOMEM TEM MORDIDO O CACHORRO" TODOS OS DIAS NO STF', 'description': 'Mais uma decisão monocrática, esdrúxula e ao arrepio da lei vinda do Supremo: Gilmar Mendes tira o Bolsa Família do teto de gastos e dispensa PEC. O que o ministro fez foi tirar do Parlamento a decisão sobre o orçamento, que é de competência apenas do Congresso Nacional. Mas as ilegalidades não param por aí. A decisão de Gilmar foi proferida dentro de um processo que estava arquivado desde fevereiro de 2022, sem possibilidade alguma de recurso, já transitado em julgado. Segundo a imprensa, foi por provocação política que desarquivou-se ILEGALMENTE esse processo. Isso é que deveria ser notícia! 

Há um chavão no jornalismo que diz que um cachorro morder uma pessoa não é notícia porque é algo banal e corriqueiro, mas quando um homem morde um cachorro, aí é notícia. No Brasil, especialmente no STF, porém, “o homem tem mordido o cachorro" todos os dias, mas a imprensa não tem noticiado...  A notícia dos jornais deveria ser a ilegalidade da decisão de Gilmar Mendes e não o despacho por si só. É isso que é anormal! Ou, quem sabe, por ser tão corriqueiro até mesmo a imprensa prefere já não noticiar o mais absurdo, acabando por ser omissa e conivente com os ataques ao Estado de Direito vindos do STF? Globo, Estadão, Folha, Uol, Grupo RBS, Veja, IstoÉ... será a mídia tradicional conivente hoje com tudo isso para, em um ou dois anos (ou até mesmo antes) perceberem que é tarde demais?

Estamos vivendo uma ditadura do Poder Judiciário e todos precisam acordar para essa grave realidade, caso contrário em pouco tempo estaremos vivendo em um Estado de Exceção ainda pior do que o atual, semelhante ao que hoje vigora na Venezuela e em outras ditaduras. Que o Congresso reaja - ou será insignificante no Brasil e já não teremos mais democracia.', 'thumbnails': {'default': {'url': 'https://i.ytimg.com/vi/Bd-EkNnAH1A/default.jpg', 'width': 120, 'height': 90}, 'medium': {'url': 'https://i.ytimg.com/vi/Bd-EkNnAH1A/mqdefault.jpg', 'width': 320, 'height': 180}, 'high': {'url': 'https://i.ytimg.com/vi/Bd-EkNnAH1A/hqdefault.jpg', 'width': 480, 'height': 360}, 'standard': {'url': 'https://i.ytimg.com/vi/Bd-EkNnAH1A/sddefault.jpg', 'width': 640, 'height': 480}, 'maxres': {'url': 'https://i.ytimg.com/vi/Bd-EkNnAH1A/maxresdefault.jpg', 'width': 1280, 'height': 720}}, 'channelTitle': 'Marcel van Hattem', 'playlistId': 'UUAGHY76tgzPiiXpJtM1sVCg', 'position': 182, 'resourceId': {'kind': 'youtube#video', 'videoId': 'Bd-EkNnAH1A'}, 'videoOwnerChannelTitle': 'Marcel van Hattem', 'videoOwnerChannelId': 'UCAGHY76tgzPiiXpJtM1sVCg'}

{'publishedAt': '2022-12-19T18:20:42Z', 'channelId': 'UCAGHY76tgzPiiXpJtM1sVCg', 'title': 'O CONGRESSO ESTÁ SENDO JANTADO COM FAROFA PELO STF', 'description': 'Só não percebe quem não quer: hoje quem manda no Brasil é o Supremo Tribunal Federal. Com uma canetada o ministro Gilmar Mendes decidiu tirar o Bolsa Família do teto de gastos e que não é necessário uma PEC para tratar do assunto. Logo depois, o plenário do STF julgou que as emendas de relator são inconstitucionais (sou contra as emendas de relator, mas discordo que o STF deva decidir a seu respeito). São claros exemplos de que a Corte está extrapolando suas prerrogativas e legislando. 

