{'publishedAt': '2022-12-15T21:45:50Z', 'channelId': 'UCAGHY76tgzPiiXpJtM1sVCg', 'title': 'RODRIGO PACHECO, TOME PROVIDÊNCIAS!', 'description': 'Na sessão de hoje do Congresso Nacional, cobrei do presidente Rodrigo Pacheco que o Parlamento esteja focado apenas em uma pauta neste momento: o retorno da nossa democracia e do Estado de Direito pleno. Não podemos mais aceitar a perseguição política praticada pelo STF e pelo TSE. O Judiciário tem passado por cima das atribuições de outros Poderes e cabe ao Congresso recolocar as coisas em seu devido lugar. 

