{'publishedAt': '2022-11-16T23:42:57Z', 'channelId': 'UCAGHY76tgzPiiXpJtM1sVCg', 'title': 'SOU TOTALMENTE CONTRA PL PARA REGULAR AS MÍDIAS SOCIAIS', 'description': 'Não há a menor possibilidade de eu ser favorável a um projeto que pretenda regular as mídias sociais pois isso interferirá na liberdade de expressão e nos direitos dos usuários. Há, sim, excessos nesses meios e até crimes que são cometidos nas redes, mas para combatê-los já existe legislação que tipifica crimes de calúnia, difamação, ofensa contra a honra e a pedofilia, por exemplo. 

