{'publishedAt': '2022-11-14T15:42:57Z', 'channelId': 'UCAGHY76tgzPiiXpJtM1sVCg', 'title': 'É DEVER DO CONGRESSO DEFENDER A LIBERDADE DE EXPRESSÃO NO BRASIL', 'description': 'Não tenho a menor dúvida de que a mudança política que o Brasil vem presenciando nos últimos anos se deve também ao poder que as redes sociais deram aos cidadãos. Essa nova forma de comunicação permite que a opinião de todos reverbere mais fortemente e que as insatisfações cheguem aos que estão no poder, inclusive sob forma de pressão. O problema é que nem todas as autoridades no establishment concordam com essa nova voz que ecoa forte pelo país, que cobra e, acima de tudo, quer respostas para seus questionamentos. 

E é aí que começa a censura aos cidadãos, incluindo parlamentares, em suas redes sociais. Trata-se de uma verdadeira caça às bruxas aos que ousam pensar diferente. Uma censura que se traveste, mentirosamente, de combate a fake news, mas que na verdade vem sendo colocada em prática por aqueles que deveriam guardar a nossa Constituição contra quem ousa questionar seus abusos: os ministros do STF e do TSE. 

Em minha fala no plenário da Câmara dos Deputados, na quinta-feira (10), relembrei como a participação da população brasileira na política ficou mais forte a partir de 2013, quando vimos as primeiras manifestações. Mas, hoje, essa liberdade de expressão está ameaçada. Cabe ao Congresso defender o direito da população de continuar se expressando livremente, impedindo que essa ditadura do judiciário seja permanente. Não podemos ficar calados diante dessa afronta ao Estado de Direito.', 'thumbnails': {'default': {'url': 'https://i.ytimg.com/vi/rKyiI7xYPb0/default.jpg', 'width': 120, 'height': 90}, 'medium': {'url': 'https://i.ytimg.com/vi/rKyiI7xYPb0/mqdefault.jpg', 'width': 320, 'height': 180}, 'high': {'url': 'https://i.ytimg.com/vi/rKyiI7xYPb0/hqdefault.jpg', 'width': 480, 'height': 360}, 'standard': {'url': 'https://i.ytimg.com/vi/rKyiI7xYPb0/sddefault.jpg', 'width': 640, 'height': 480}, 'maxres': {'url': 'https://i.ytimg.com/vi/rKyiI7xYPb0/maxresdefault.jpg', 'width': 1280, 'height': 720}}, 'channelTitle': 'Marcel van Hattem', 'playlistId': 'UUAGHY76tgzPiiXpJtM1sVCg', 'position': 225, 'resourceId': {'kind': 'youtube#video', 'videoId': 'rKyiI7xYPb0'}, 'videoOwnerChannelTitle': 'Marcel van Hattem', 'videoOwnerChannelId': 'UCAGHY76tgzPiiXpJtM1sVCg'}

{'publishedAt': '2022-11-11T13:20:19Z', 'channelId': 'UCAGHY76tgzPiiXpJtM1sVCg', 'title': 'NÃO PODEMOS VIRAR UMA NOVA ARGENTINA!', 'description': 'É óbvio que precisamos resgatar a população mais vulnerável, que está em situação de miserabilidade: votei a favor do auxílio emergencial e a favor da substituição do Bolsa Família pelo Auxílio Brasil, mais focalizado. No entanto, sempre que a manutenção desses programas dependia de furo no teto, fomos contrários como bancada - só o Novo, aliás, manteve essa coerência com a responsabilidade fiscal!

