{'publishedAt': '2022-11-10T18:48:08Z', 'channelId': 'UCAGHY76tgzPiiXpJtM1sVCg', 'title': 'A DIREITA PRECISA ATUAR COMO OPOSICÃO ATIVA E ARTICULADA CONTRA O GOVERNO LULA', 'description': 'A atuação dos parlamentares de direita no Congresso Nacional precisa mudar drasticamente. Devemos fazer uma oposição ativa e articulada, sem dar margem para essa bagunça que estamos presenciando e que ajudou Lula a se eleger. 

Em mais de uma oportunidade, o Congresso deixou de atuar firmemente e permitiu, por exemplo, a prisão de um parlamentar que possui imunidade; aceitou a interferência externa do STF por meio de opiniões na discussão do voto impresso e não votou a prisão em segunda instância, uma maneira democrática de reverter a decisão do Supremo que acabou por libertar Lula. Citei apenas três exemplos das vezes em que o Congresso abriu mão da sua soberania, mas há muitos outros. 

