{'publishedAt': '2022-11-09T18:11:08Z', 'channelId': 'UCAGHY76tgzPiiXpJtM1sVCg', 'title': 'É O GOVERNO QUE DEVE SE CURVAR ÀS REGRAS DA ECONOMIA, NÃO O CONTRÁRIO', 'description': 'Desde 2006 não há reajuste nos valores para enquadramento no Simples Nacional, fazendo com que empreendedores cheguem a optar pela informalidade para poderem crescer. Muitos estão no limite não necessariamente porque aumentaram suas vendas, mas porque o valor do dinheiro foi corroído ao longo desses dezesseis anos em que não houve nenhuma atualização na tabela do Simples e do MEI. 

