{'publishedAt': '2022-10-13T11:42:17Z', 'channelId': 'UCAGHY76tgzPiiXpJtM1sVCg', 'title': 'O SEGUNDO TURNO É UM DIVISOR DE ÁGUAS PARA O BRASIL', 'description': 'Não nos iludamos: as eleições deste ano não são apenas sobre quem vai governar o Brasil nos próximos quatro anos, mas também será definido como será o nosso futuro nas próximas décadas. Ainda hoje sentimos os efeitos negativos do PT à frente da presidência da República. Portanto, caso se confirme o que ocorreu no primeiro turno com uma eventual vitória de Lula e do PT, estaremos entregando novamente o Brasil nas mãos de uma quadrilha que pilhou nossas instituições, corrompeu o Congresso e fez da corrupção sua marca. 

