{'publishedAt': '2022-08-01T23:31:51Z', 'channelId': 'UCAGHY76tgzPiiXpJtM1sVCg', 'title': 'CÂMARA DOS DEPUTADOS VAZIA É DESRESPEITO COM A POPULAÇÃO', 'description': 'O plenário da Câmara dos Deputados está completamente vazio no começo desta semana de esforço concentrado. Para piorar, a situação não mudará, pois foi decidido, hoje, que todas as votações da semana serão virtuais.  

