{'publishedAt': '2022-07-26T02:11:09Z', 'channelId': 'UCAGHY76tgzPiiXpJtM1sVCg', 'title': '"MEU DEUS, EU NÃO ACREDITO!", DIZ DONA FILOMENA AO SER SURPREENDIDA COM MINHA VISITA!', 'description': 'Muitos insistem que a política é ingrata e só traz dissabores - e, de fato, quem é honesto e quer mudar a política de verdade enfrenta muitas resistências, frustrações e até mesmo ofensas gratuitas ao longo do caminho. No entanto, há situações que me fazem superar tudo isso e ter certeza de que estou investindo parte importantíssima da minha própria vida na atividade certa, como o carinho que recebo de muitas pessoas que me acompanham nas redes. 

É o caso da Maria Filomena Freitas, que mora em Belém do Pará, e lá do norte do país me acompanha pelos grupos de WhatsApp do mandato e encaminha todos meus vídeos para seus contatos. Dona Filomena está visitando seu filho Cristiano em Novo Hamburgo e ele, que fez contato comigo através do meu primo Nilson Flor, seu conhecido, decidiu fazer uma surpresa para a mãe: me convidou para visitá-lo na casa dele em Novo Hamburgo para tirar uma foto com ela. Com um detalhe: o Cristiano me pediu que fosse uma surpresa. E foi! É só ver as imagens para se emocionar junto comigo com o susto que dona Filomena levou ao me ver entrando na casa do filho, que lhe havia dito apenas que iria receber em casa "amigos": "vou morrer!", exclamou ela, surpresa e alegre. 

Esses momentos são especiais e muito, mas muito gratificantes para mim. E se a dona Filomena ficou emocionada com o momento, imagina como fico eu ao receber um abraço daqueles de alguém que nem me conhecia pessoalmente até então? Ah, e uma curiosidade: dona Filomena é tia do jogador Clemer, ídolo da torcida colorada e goleiro do mundial. O Cristiano fez até uma videochamada com o primo para compartilhar o momento. Acompanhe comigo!', 'thumbnails': {'default': {'url': 'https://i.ytimg.com/vi/FO6gZlJrUmk/default.jpg', 'width': 120, 'height': 90}, 'medium': {'url': 'https://i.ytimg.com/vi/FO6gZlJrUmk/mqdefault.jpg', 'width': 320, 'height': 180}, 'high': {'url': 'https://i.ytimg.com/vi/FO6gZlJrUmk/hqdefault.jpg', 'width': 480, 'height': 360}, 'standard': {'url': 'https://i.ytimg.com/vi/FO6gZlJrUmk/sddefault.jpg', 'width': 640, 'height': 480}, 'maxres': {'url': 'https://i.ytimg.com/vi/FO6gZlJrUmk/maxresdefault.jpg', 'width': 1280, 'height': 720}}, 'channelTitle': 'Marcel van Hattem', 'playlistId': 'UUAGHY76tgzPiiXpJtM1sVCg', 'position': 367, 'resourceId': {'kind': 'youtube#video', 'videoId': 'FO6gZlJrUmk'}, 'videoOwnerChannelTitle': 'Marcel van Hattem', 'videoOwnerChannelId': 'UCAGHY76tgzPiiXpJtM1sVCg'}

{'publishedAt': '2022-07-14T01:27:44Z', 'channelId': 'UCAGHY76tgzPiiXpJtM1sVCg', 'title': 'ENFERMEIROS ESTÃO SENDO ENGANADOS DE NOVO!', 'description': 'Não tenho a menor dúvida de que todos os enfermeiros merecem receber salários mais dignos. Por isso mesmo me nego a votar a favor de uma proposta populista, que vai mais uma vez ENGANAR os enfermeiros.   

