{'publishedAt': '2022-07-08T11:32:12Z', 'channelId': 'UCAGHY76tgzPiiXpJtM1sVCg', 'title': 'INCONCEBÍVEL QUE A CÂMARA REALIZE SESSÕES FAKES NA MADRUGADA', 'description': 'O que estamos presenciando nos últimos dias na Câmara dos Deputados é uma DESONRA para o Parlamento: o regimento está sendo jogado no lixo com sessões fakes, de menos de um minuto de duração, em uma tentativa desesperada de se aprovar a PEC KAMIKAZE. 

