{'publishedAt': '2022-07-08T00:04:01Z', 'channelId': 'UCAGHY76tgzPiiXpJtM1sVCg', 'title': 'O PARLAMENTO NÃO ESTÁ PREOCUPADO COM O PAÍS, APENAS COM A ELEIÇÃO', 'description': 'Parlamentares estão argumentando que a fome tem pressa como justificativa para aprovar a PEC Kamikaze. Sim, a fome tem pressa, mas no caso desta PEC a verdade é uma só: A FOME É DE VOTOS! O auxílio é para as campanhas eleitorais dos políticos. A pressa é para aumentar despesa, para furar o teto em 41 BILHÕES e não para corrigir os problemas estruturais que deixam o Brasil cada vez mais para trás internacionalmente.  

