{'publishedAt': '2022-06-11T11:30:06Z', 'channelId': 'UCAGHY76tgzPiiXpJtM1sVCg', 'title': 'COMUNISMO, NAZISMO E FASCISMO MERECEM A LATA DE LIXO DA HISTÓRIA', 'description': 'É muito importante que tenhamos sempre em nossa memória os crimes e excessos que foram cometidos por regimes totalitários em nome de uma pretensa democracia. Experimentos cruéis com vidas humanas, violência extrema, tortura e morte de inocentes não podem jamais ser tolerados.  

