{'publishedAt': '2022-06-03T23:32:33Z', 'channelId': 'UCAGHY76tgzPiiXpJtM1sVCg', 'title': 'CÓDIGO FLORESTAL BRASILEIRO COMPLETA 10 ANOS', 'description': 'Comemoramos nesta semana os 10 anos do Código Florestal brasileiro – um marco na proteção ao meio ambiente em equilíbrio com a produção agropecuária. Hoje temos um dos códigos mais avançados do mundo, inclusive melhor do que muitos dos países que costumam criticar a política ambiental do Brasil. 

