{'publishedAt': '2022-05-30T11:30:06Z', 'channelId': 'UCAGHY76tgzPiiXpJtM1sVCg', 'title': 'É PRECISO DENUNCIAR PROJETOS POPULISTAS E ELEITOREIROS', 'description': 'Com frequência tenho usado a tribuna do plenário da Câmara dos Deputados para alertar sobre projetos populistas que estão sendo aprovados apenas com interesses eleitoreiros. Foi assim com o piso nacional dos enfermeiros que sequer foi sancionado pelo presidente da República, pois não há recursos para pagar esse aumento.  

O mesmo ocorreu na semana passada, quando parlamentares demagogos aprovaram descontos de até 99% nas dívidas do Fies. Qual mensagem estamos querendo passar à população quando se aprova esse tipo de projeto? Que compensa ser inadimplente?   

Não sou contra a possibilidade de renegociação para aqueles que por algum motivo não puderam pagar o financiamento; inclusive é isso acontece normalmente. Mas o bom pagador não pode ser prejudicado, como ocorreu nesse caso, em que foi concedido desconto de até 99% sobre o valor total devido.  Recebi inúmeros relatos de estudantes que se sentiram injustiçados por pagarem em dia e não receberem nenhum desconto. Não é assim que vamos resolver os problemas do nosso país, com demagogia. Precisamos cada vez mais de políticos sérios e que encarem seu trabalho no Congresso Nacional com a maior responsabilidade possível. A Voz do Brasil deu destaque para minha defesa contra esse tipo de atitude populista de alguns parlamentares.', 'thumbnails': {'default': {'url': 'https://i.ytimg.com/vi/T_-c39jh7mk/default.jpg', 'width': 120, 'height': 90}, 'medium': {'url': 'https://i.ytimg.com/vi/T_-c39jh7mk/mqdefault.jpg', 'width': 320, 'height': 180}, 'high': {'url': 'https://i.ytimg.com/vi/T_-c39jh7mk/hqdefault.jpg', 'width': 480, 'height': 360}, 'standard': {'url': 'https://i.ytimg.com/vi/T_-c39jh7mk/sddefault.jpg', 'width': 640, 'height': 480}}, 'channelTitle': 'Marcel van Hattem', 'playlistId': 'UUAGHY76tgzPiiXpJtM1sVCg', 'position': 395, 'resourceId': {'kind': 'youtube#video', 'videoId': 'T_-c39jh7mk'}, 'videoOwnerChannelTitle': 'Marcel van Hattem', 'videoOwnerChannelId': 'UCAGHY76tgzPiiXpJtM1sVCg'}

{'publishedAt': '2022-05-05T16:55:50Z', 'channelId': 'UCAGHY76tgzPiiXpJtM1sVCg', 'title': 'EU NÃO CONSIGO MENTIR EM TROCA DE VOTOS! | Marcel van Hattem', 'description': 'Eu não tenho condição de olhar para um enfermeiro amigo meu e dizer: estou te enganando, mentindo para você porque eu quero o teu voto. Pois foi isso o que aconteceu ontem, quando vários parlamentares usaram de discurso populista e eleitoreiro para defender algo que, pasmem, NÃO SERÁ PAGO! Isso foi dito em plenário, o presidente da República não sancionará o piso salarial dos enfermeiros enquanto não acharem formas de pagá-lo. O próprio líder do governo, Ricardo Barros, e o deputado Eduardo Bolsonaro votaram contra.  

