{'publishedAt': '2022-04-27T22:48:36Z', 'channelId': 'UCAGHY76tgzPiiXpJtM1sVCg', 'title': 'MAIS UMA PROPOSTA POPULISTA APROVADA PELA CÂMARA EM ANO ELEITORAL', 'description': 'É muito triste que o plenário da Câmara dos Deputados tenha aprovado de forma vitalícia o auxílio emergencial de R$ 400. Não é que somos contra ajudar os mais pobres, pelo contrário: precisamos de políticas públicas que ajudem esses brasileiros a saírem da miséria, que deem uma porta de saída e propicie oportunidade de trabalho para quem não tem ocupação.  

