{'publishedAt': '2022-04-24T21:07:14Z', 'channelId': 'UCAGHY76tgzPiiXpJtM1sVCg', 'title': 'O RIO DE JANEIRO MERECE PAULO GANIME COMO GOVERNADOR', 'description': 'Não sei se todos sabem, mas o meu colega de bancada na Câmara dos Deputados Paulo Ganime tinha uma carreira de sucesso no exterior quando resolveu retornar para o Brasil para ajudar a mudar o nosso país. Logo quando ele assumiu como deputado federal e nos tornamos colegas de parlamento, lembro que fui “dar um Google” no nome dele e acabei assistindo ao vídeo dele para a campanha de 2018 contando sua linda história.   

Uma parte do vídeo me tocou profundamente, quando Paulo Ganime conta que, logo após seu nascimento, foi dado como um caso perdido pelos médicos. Ali eu pude entender melhor o que significa não ser e não aceitar ser um caso perdido. O Paulo foi vencendo todos os desafios, demonstrando não apenas que não é um caso perdido como também dando o seu melhor para ajudar a todos a seu redor, inclusive seu Estado do Rio, também por muitos considerado um caso perdido na política. 

