{'publishedAt': '2022-04-20T21:33:32Z', 'channelId': 'UCAGHY76tgzPiiXpJtM1sVCg', 'title': 'SINCALISTAS COM SALÁRIOS DE R$ 30 MIL RECLAMAM DE REAJUSTE DE 5%', 'description': 'Milhões de brasileiros estão desempregados, passando fome e outros milhões tentam sobreviver com um salário mínimo de R$ 1.200. Na outra ponta, sindicalistas do serviço público reclamam que um reajuste de 5% é pouco. Pouco?  

