{'publishedAt': '2022-03-31T21:38:48Z', 'channelId': 'UCAGHY76tgzPiiXpJtM1sVCg', 'title': 'NÃO SE RESPEITA MAIS A CONSTITUIÇÃO EM BRASÍLIA?', 'description': 'Poucos têm acertado nessa história envolvendo o deputado Daniel Silveira. Primeiro, o próprio Daniel com o vídeo extremamente grosseiro e infeliz. O ministro do Supremo Alexandre de Moraes errou ao decretar uma prisão inconstitucional, extrapolando inclusive as competências entre os Poderes, em uma clara perseguição pessoal e política.  

