{'publishedAt': '2022-03-31T00:41:43Z', 'channelId': 'UCAGHY76tgzPiiXpJtM1sVCg', 'title': 'O FINANCIAMENTO PÚBLICO DE CAMPANHA PRECISA ACABAR', 'description': 'O partido NOVO é contra a PEC 18 que prevê a obrigatoriedade dos partidos utilizarem ao menos 5% do fundo partidário para programas voltados à participação de mulheres na política, incluindo campanhas de candidatas. Na eleição passada nós vimos o que ocorreu quando há exigência de percentuais para candidatas mulheres: um laranjal. Muitas candidatas foram usadas apenas para que os recursos fossem destinados para outros candidatos e, pior, a maioria homens. 

O NOVO é contra o fundo eleitoral e o fundo partidário. O pagador de impostos não pode ser obrigado a pagar campanha de candidatos que ele nem apoia. O financiamento deve ser feito por aqueles que têm interesse direto no processo político, os cidadãos. Nesse caso o eleitor fará uma doação para o candidato com quem tem realmente afinidade com ele.  

O partido NOVO comprovou na eleição de 2018 que é possível fazer campanhas com poucos recursos e ótimos resultados, inclusive com grande participação das mulheres. Dos vereadores do Partido NOVO eleitos em 2018, 35% foram mulheres. Portanto, o financiamento público deve acabar.', 'thumbnails': {'default': {'url': 'https://i.ytimg.com/vi/_eKDN0IVFic/default.jpg', 'width': 120, 'height': 90}, 'medium': {'url': 'https://i.ytimg.com/vi/_eKDN0IVFic/mqdefault.jpg', 'width': 320, 'height': 180}, 'high': {'url': 'https://i.ytimg.com/vi/_eKDN0IVFic/hqdefault.jpg', 'width': 480, 'height': 360}, 'standard': {'url': 'https://i.ytimg.com/vi/_eKDN0IVFic/sddefault.jpg', 'width': 640, 'height': 480}, 'maxres': {'url': 'https://i.ytimg.com/vi/_eKDN0IVFic/maxresdefault.jpg', 'width': 1280, 'height': 720}}, 'channelTitle': 'Marcel van Hattem', 'playlistId': 'UUAGHY76tgzPiiXpJtM1sVCg', 'position': 450, 'resourceId': {'kind': 'youtube#video', 'videoId': '_eKDN0IVFic'}, 'videoOwnerChannelTitle': 'Marcel van Hattem', 'videoOwnerChannelId': 'UCAGHY76tgzPiiXpJtM1sVCg'}

{'publishedAt': '2022-03-29T22:30:01Z', 'channelId': 'UCAGHY76tgzPiiXpJtM1sVCg', 'title': 'ESCRITÓRIO DE TARSO GENRO (PT) PEDE PASSAPORTE VACINAL NAS UNIVERSIDADES E JUSTIÇA ACATA', 'description': 'É lamentável a decisão da Justiça Federal do Rio Grande do Sul que obrigou a Universidade Federal do Rio Grande do Sul (UFRGS) a exigir passaporte vacinal para a realização de todas as atividades presenciais na instituição, indo na contramão do que determinou o reitor Carlos Bulhões.  

