{'publishedAt': '2022-03-29T11:34:46Z', 'channelId': 'UCAGHY76tgzPiiXpJtM1sVCg', 'title': 'SOU CONTRA A OBRIGATORIEDADE DE PARTIDOS USAREM O FUNDO ELEITORAL', 'description': 'Sempre defendi e vou continuar defendendo o fim do financiamento público de campanha. Esse dinheiro não deveria nem ter saído do bolso do cidadão e uma vez que saiu deveria ir para áreas como saúde e educação.  

Justamente por essa defesa, acho um absurdo que a legislação exija que todos os partidos usem 5% do fundo partidário em candidaturas de mulheres. Nós do NOVO somos contra o uso de uma forma geral e nossos resultados eleitorais comprovam que o dinheiro público sequer é necessário, nem para as candidaturas femininas.  

