{'publishedAt': '2022-03-25T11:40:04Z', 'channelId': 'UCAGHY76tgzPiiXpJtM1sVCg', 'title': 'QUANDO VISITAR DOIS IRMÃOS?', 'description': 'A reposta para essa pergunta não é tão simples e não facilitamos para o embaixador da Alemanha, Heiko Thoms, ao apresentarmos as atrações do município de Dois Irmãos durante almoço na embaixada alemã. 

Junto com o prefeito Jerri Meneghetti e o vice Juarez Stein falamos sobre a programação para comemorar os 200 anos da imigração alemã na região do Vale dos Sinos e as festividades do Kerb de São Miguel que ocorre em setembro e o Natal dos Anjos – evento de Dois Irmãos que é reconhecido nacionalmente. Heiko Thoms confirmou que pretende ir ao Estado, só falta agora decidir pela data. 

Durante o encontro também ficou acertada uma reunião com o Cônsul Geral da Alemanha no Rio Grande do Sul, Milan Simandl, para tratar das comemorações do bicentenário da imigração alemã. Agradeço ao embaixador Heiko Thoms pela ótima recepção que tivemos.', 'thumbnails': {'default': {'url': 'https://i.ytimg.com/vi/ogic8m2gaLY/default.jpg', 'width': 120, 'height': 90}, 'medium': {'url': 'https://i.ytimg.com/vi/ogic8m2gaLY/mqdefault.jpg', 'width': 320, 'height': 180}, 'high': {'url': 'https://i.ytimg.com/vi/ogic8m2gaLY/hqdefault.jpg', 'width': 480, 'height': 360}, 'standard': {'url': 'https://i.ytimg.com/vi/ogic8m2gaLY/sddefault.jpg', 'width': 640, 'height': 480}, 'maxres': {'url': 'https://i.ytimg.com/vi/ogic8m2gaLY/maxresdefault.jpg', 'width': 1280, 'height': 720}}, 'channelTitle': 'Marcel van Hattem', 'playlistId': 'UUAGHY76tgzPiiXpJtM1sVCg', 'position': 455, 'resourceId': {'kind': 'youtube#video', 'videoId': 'ogic8m2gaLY'}, 'videoOwnerChannelTitle': 'Marcel van Hattem', 'videoOwnerChannelId': 'UCAGHY76tgzPiiXpJtM1sVCg'}

{'publishedAt': '2022-03-24T00:45:12Z', 'channelId': 'UCAGHY76tgzPiiXpJtM1sVCg', 'title': 'A DEMAGOGIA E A MENTIRA CUSTAM CARO', 'description': 'Em primeiro lugar quero deixar claro o meu respeito e admiração pelos profissionais da enfermagem. Justamente por isso eu não tenho coragem de mentir, de enganar, de ser demagogo em um assunto tão sério que vai gerar desemprego!  

Infelizmente essa é a realidade. Quem diz o contrário está pensando nos votos ali na frente porque até o piso entrar em vigor é bem provável que a eleição já tenha passado. Escutei na sessão de ontem, quando foi votada a urgência do projeto, muitos colegas parlamentares admitindo que o piso salarial vai acabar gerando desemprego e problemas para as administrações de hospitais. Mas com receio do impacto eleitoral negativo, votaram a favor da urgência. Populismo barato.  

Na minha fala nesta noite no plenário, li uma mensagem que recebi de uma enfermeira, na qual ela afirma que sabe o que vai acontecer: os enfermeiros vão ser substituídos por técnicos de enfermagem, haverá acúmulo de trabalho, entre tantos outros problemas. Essa é a realidade dita por alguém que vive o dia a dia em um hospital, não de alguém que está com seu emprego e salário garantido aqui no Parlamento. Infelizmente muitas pessoas não querem ouvir a realidade: preferem se autoenganar em ano de eleição com demagogia barata.', 'thumbnails': {'default': {'url': 'https://i.ytimg.com/vi/Stjwj1k9jiE/default.jpg', 'width': 120, 'height': 90}, 'medium': {'url': 'https://i.ytimg.com/vi/Stjwj1k9jiE/mqdefault.jpg', 'width': 320, 'height': 180}, 'high': {'url': 'https://i.ytimg.com/vi/Stjwj1k9jiE/hqdefault.jpg', 'width': 480, 'height': 360}, 'standard': {'url': 'https://i.ytimg.com/vi/Stjwj1k9jiE/sddefault.jpg', 'width': 640, 'height': 480}, 'maxres': {'url': 'https://i.ytimg.com/vi/Stjwj1k9jiE/maxresdefault.jpg', 'width': 1280, 'height': 720}}, 'channelTitle': 'Marcel van Hattem', 'playlistId': 'UUAGHY76tgzPiiXpJtM1sVCg', 'position': 456, 'resourceId': {'kind': 'youtube#video', 'videoId': 'Stjwj1k9jiE'}, 'videoOwnerChannelTitle': 'Marcel van Hattem', 'videoOwnerChannelId': 'UCAGHY76tgzPiiXpJtM1sVCg'}

{'publishedAt': '2022-03-19T15:39:45Z', 'channelId': 'UCAGHY76tgzPiiXpJtM1sVCg', 'title': 'HISTÓRIA GAÚCHA PRESERVADA', 'description': 'Recentemente estive em Pelotas e visitei o Obelisco Republicano, monumento histórico que será restaurado com recursos de emenda parlamentar do nosso gabinete. Gosto de visitar pessoalmente os locais selecionados para receber nossas emendas até como uma forma de fiscalizar os investimentos feitos com recursos do pagador de impostos e que estão retornando para a população.   

Neste caso, não só o monumento será restaurado, mas também todo o entorno, propiciando um novo espaço de lazer para os moradores. Tombado pelo Instituto do Patrimônio Histórico e Artístico Nacional (Iphan), o Obelisco Republicano data de 1885, ainda no período monárquico, e é uma homenagem a Domingos José de Almeida, financiador da Revolução Farroupilha e ministro da Fazenda da República Riograndense.   

A obra tem um custo previsto de R$ 500 mil, sendo R$ 250 mil destinados pelo nosso gabinete a partir de processo seletivo na área de infraestrutura turística e o restante como contrapartida da prefeitura. Assista ao vídeo que fiz no local, junto com o arquiteto responsável pela obra Fábio Caetano e os secretários Paulo Pedroso (Cultura) e Gilmar Bazanella (Desenvolvimento e Turismo).', 'thumbnails': {'default': {'url': 'https://i.ytimg.com/vi/Db-v1ERTzZ4/default.jpg', 'width': 120, 'height': 90}, 'medium': {'url': 'https://i.ytimg.com/vi/Db-v1ERTzZ4/mqdefault.jpg', 'width': 320, 'height': 180}, 'high': {'url': 'https://i.ytimg.com/vi/Db-v1ERTzZ4/hqdefault.jpg', 'width': 480, 'height': 360}, 'standard': {'url': 'https://i.ytimg.com/vi/Db-v1ERTzZ4/sddefault.jpg', 'width': 640, 'height': 480}, 'maxres': {'url': 'https://i.ytimg.com/vi/Db-v1ERTzZ4/maxresdefault.jpg', 'width': 1280, 'height': 720}}, 'channelTitle': 'Marcel van Hattem', 'playlistId': 'UUAGHY76tgzPiiXpJtM1sVCg', 'position': 460, 'resourceId': {'kind': 'youtube#video', 'videoId': 'Db-v1ERTzZ4'}, 'videoOwnerChannelTitle': 'Marcel van Hattem', 'videoOwnerChannelId': 'UCAGHY76tgzPiiXpJtM1sVCg'}

{'publishedAt': '2022-03-19T00:01:55Z', 'channelId': 'UCAGHY76tgzPiiXpJtM1sVCg', 'title': 'RIO GRANDE DO SUL PODERÁ RECEBER REFUGIADOS UCRANIANOS', 'description': 'Como havia me comprometido com o encarregado de negócios da Embaixada da Ucrânia no Brasil, Anatoliy Tkach, conversei nesta sexta-feira com o governador Eduardo Leite sobre o Rio Grande do Sul também ter uma acolhida humanitária para os refugiados ucranianos. O governador atendeu prontamente a solicitação e sugeriu que o vice-governador, Ranolfo Vieira Júnior, fosse o responsável pela coordenação dos trabalhos.  

