{'publishedAt': '2022-03-16T21:23:43Z', 'channelId': 'UCAGHY76tgzPiiXpJtM1sVCg', 'title': 'PREFEITO PETISTA SEGUE COM\xa0PERSEGUIÇÃO POLÍTICA EM SÃO LEOPOLDO!', 'description': 'Lamentavelmente o prefeito petista Ary Vanazzi continua com sua perseguição política no município de São Leopoldo. Pasmem, o prefeito deu prazo de 48 horas para que um pai apresente comprovante de vacina ou atestado médico do filho, caso contrário este não poderá frequentar a sala de aula. Um absurdo! Estamos no fim da pandemia, muitas cidades pelo país e também no Rio Grande do Sul não estão mais exigindo o uso de máscara e o prefeito atenta contra a liberdade dos pais de decidirem sobre seus filhos. Isso é perseguição política.  

