{'publishedAt': '2022-03-16T16:18:05Z', 'channelId': 'UCAGHY76tgzPiiXpJtM1sVCg', 'title': 'A TRIBUNA DA CÂMARA DOS DEPUTADOS FOI VIOLADA', 'description': 'É gravíssima a censura que foi imposta a quase quinhentos deputados federais na sessão da Câmara na última quinta-feira (10). Nós, parlamentares, fomos impedidos de nos pronunciarmos após uma decisão arbitrária da Mesa Diretora, que mudou as regras das sessões virtuais: agora só se pode votar de forma remota, não se pode mais falar pelo Zoom. A ironia é que isso ocorreu justamente em um Parlamento, local onde se parla, se fala!

