{'publishedAt': '2022-02-26T14:27:11Z', 'channelId': 'UCAGHY76tgzPiiXpJtM1sVCg', 'title': 'EXIGIR MÁSCARAS NAS ESCOLAS SEM NECESSIDADE PREJUDICA O DESENVOLVIMENTO DAS CRIANÇAS', 'description': 'Falei na tribuna da Câmara dos Deputados sobre a exigência de máscaras para que crianças voltem a frequentar escolas tanto públicas quanto privadas. Além de ir contra as diretrizes da OMS, já há várias pesquisas indicando que o uso de máscaras pode ser prejudicial ao desenvolvimento social e educacional da criança.  

Não podemos prejudicar nossas crianças mais do que já o foram. Os dados são estarrecedores: mais de 50% das crianças mais pobres, com seis e sete anos de idade, não sabem ler e escrever em decorrência da pandemia. Já temos na Câmara dois projetos, um da deputada Paula Belmonte e outro de autoria do deputado Jerônimo Goergen, para alterar a atual legislação que prevê a obrigatoriedade do uso de máscaras em crianças com idade entre 4 e 12 anos.   A vereadora de Porto Alegre Mariana Pimentel reforçou a importância desse assunto ao entrar em contato comigo e estamos trabalhando pela aprovação desses projetos de lei!

