{'publishedAt': '2022-02-23T19:15:49Z', 'channelId': 'UCAGHY76tgzPiiXpJtM1sVCg', 'title': 'O CIDADÃO NÃO QUER O FUNDÃO ELEITORAL BILIONÁRIO', 'description': 'O Supremo precisa escutar a população e derrubar esse aumento vergonhoso do fundão eleitoral que passou de R$ 2,1 bilhões para R$ 4,9 bilhões.  

