{'publishedAt': '2022-02-23T11:30:01Z', 'channelId': 'UCAGHY76tgzPiiXpJtM1sVCg', 'title': 'FUNDÃO ELEITORAL BILIONÁRIO É UMA VERGONHA PARA O BRASIL', 'description': 'Está na pauta do STF a análise da ação do Novo contra o aumento do fundão eleitoral de R$ 2,1 bilhões para R$ 4,9 bilhões. O devido processo legislativo não foi respeitado durante votação na Câmara dos Deputados, por isso o partido entrou com uma ação no Supremo.  

Além do mais, é inaceitável gastarmos bilhões em campanhas eleitorais enquanto milhões de brasileiros passam fome e estão desempregados. Esse dinheiro deveria ser destinado para saúde, educação e segurança e não para fazer santinhos! O fundão eleitoral bilionário, por exemplo, poderia ser um fundo para o enfrentamento de desastres como prevê o projeto apresentado pelo deputado Paulo Ganime e a bancada do Novo. Esse sim seria um destino correto para o dinheiro do pagador de impostos. 

