{'publishedAt': '2022-02-22T12:37:14Z', 'channelId': 'UCAGHY76tgzPiiXpJtM1sVCg', 'title': 'EMBAIXADOR JAPONÊS QUER CONHECER O RIO GRANDE DO SUL', 'description': 'Imaginem aprender a Língua Portuguesa em apenas quatro meses, ainda mais tendo como língua materna o japonês. Difícil, não é? Mas não é impossível. Pelo menos para o embaixador Teiji Hayashi que assumiu há pouco mais de dois meses a Embaixada do Japão no Brasil e está estudando a nossa língua há apenas quatro meses! Inclusive, nosso encontro no gabinete em Brasília foi todo falado em Português. Hayashi já falava espanhol.  
