{'publishedAt': '2022-02-13T21:09:45Z', 'channelId': 'UCAGHY76tgzPiiXpJtM1sVCg', 'title': 'O FUNDÃO ELEITORAL NÃO É DEMOCRÁTICO E NÃO SERVE PARA RENOVAR A POLÍTICA', 'description': 'O fundão eleitoral não é democrático e não serve para renovar a política, muito pelo contrário, é o caminho para a perpetuação daqueles que estão no poder. Falei sobre esse tema há pouco no programa Jovem Pan Domingo, da Jovem Pan News, com a Elisangela Carreira.  

