{'publishedAt': '2022-02-09T23:20:30Z', 'channelId': 'UCAGHY76tgzPiiXpJtM1sVCg', 'title': 'VOCÊ PREFERE COMER ARROZ E FEIJÃO OU GAFANHOTO?', 'description': 'Pois é esta a pergunta que precisa ser feita quando se trata do assunto "defensivos agrícolas". Nada de "veneno": defensivos são justamente o remédio necessário para preservar as lavouras no campo e garantir alimento no prato de todos os brasileiros!  

