{'publishedAt': '2022-02-08T11:17:05Z', 'channelId': 'UCAGHY76tgzPiiXpJtM1sVCg', 'title': 'VEREADOR DO PT COMANDA INVASÃO À IGREJA', 'description': 'É esse o nível dos políticos petistas: invadir uma igreja durante a missa e gritar palavras como "racistas" e "fascistas" aos presentes. 

