{'publishedAt': '2022-02-03T23:03:35Z', 'channelId': 'UCAGHY76tgzPiiXpJtM1sVCg', 'title': 'O DRAMA DOS GAÚCHOS COM A SECA PRECISA ACABAR!', 'description': 'Hoje falei na tribuna da Câmara dos Deputados sobre o drama que os gaúchos estão enfrentando devido à seca. É um problema recorrente e que podemos ajudar a amenizar alterando a legislação em um ponto que considero atrasado.  

De acordo com o Código Florestal brasileiro, somente pode ocorrer a supressão de vegetação em áreas de preservação permanente em casos de utilidade pública, de interesse social ou de baixo impacto ambiental. Isso impede, por exemplo, a construção de barragens e reservatórios para a irrigação nesses locais, o que é fundamental para que não enviemos as águas das chuvas diretamente para o mar.   

O Congresso precisa alterar essa lei! Não há nada que possua mais utilidade pública e maior interesse social do que a possibilidade de criarmos alternativas para o armazenamento de água e a irrigação no Rio Grande do Sul e em todo o Brasil. Nós temos as leis mais severas do mundo para coibir ilícitos ambientais, mas isso não pode acabar por sacrificar a população como hoje é o caso das milhares de famílias do Rio Grande do Sul que perderam seu sustento e estão sem acesso à água.', 'thumbnails': {'default': {'url': 'https://i.ytimg.com/vi/QgM8XiIJQJw/default.jpg', 'width': 120, 'height': 90}, 'medium': {'url': 'https://i.ytimg.com/vi/QgM8XiIJQJw/mqdefault.jpg', 'width': 320, 'height': 180}, 'high': {'url': 'https://i.ytimg.com/vi/QgM8XiIJQJw/hqdefault.jpg', 'width': 480, 'height': 360}, 'standard': {'url': 'https://i.ytimg.com/vi/QgM8XiIJQJw/sddefault.jpg', 'width': 640, 'height': 480}, 'maxres': {'url': 'https://i.ytimg.com/vi/QgM8XiIJQJw/maxresdefault.jpg', 'width': 1280, 'height': 720}}, 'channelTitle': 'Marcel van Hattem', 'playlistId': 'UUAGHY76tgzPiiXpJtM1sVCg', 'position': 498, 'resourceId': {'kind': 'youtube#video', 'videoId': 'QgM8XiIJQJw'}, 'videoOwnerChannelTitle': 'Marcel van Hattem', 'videoOwnerChannelId': 'UCAGHY76tgzPiiXpJtM1sVCg'}

