{'publishedAt': '2021-12-17T11:30:07Z', 'channelId': 'UCAGHY76tgzPiiXpJtM1sVCg', 'title': 'A EMISSÃO DE VISTO TEMPORÁRIO NÃO PODE SER BUROCRATIZADA', 'description': 'Não podemos burocratizar a emissão de visto temporário para estrangeiros que desejam vir para o Brasil para estudar, realizar pesquisas, tratamentos médicos e até mesmo para casos de vistos humanitários. 

