{'publishedAt': '2021-12-14T11:23:17Z', 'channelId': 'UCAGHY76tgzPiiXpJtM1sVCg', 'title': 'UFRGS AMPLIA NÚMERO DE ALUNOS EM AULAS PRESENCIAIS A PARTIR DE JANEIRO', 'description': 'O deputado Fábio Ostermann e eu estivemos na UFRGS, universidade onde estudamos, para uma agenda com o reitor Carlos Bulhões e com o Pró-Reitor de Inovação e Relações Institucionais, Geraldo Jotz. Conversamos sobre o retorno dos alunos de forma presencial à universidade. 

