{'publishedAt': '2021-12-02T23:05:52Z', 'channelId': 'UCAGHY76tgzPiiXpJtM1sVCg', 'title': 'DISCURSO POPULISTA DE POLÍTICOS MAIS UMA VEZ PREJUDICA O TRABALHADOR', 'description': 'Novamente políticos com seu discurso populista e eleitoreiro prejudicaram o trabalhador e o empresário brasileiro. Foi aprovado ontem na Câmara projeto do PSOL impondo mais regulamentações às empresas de aplicativo durante a pandemia. 

Reafirmo que é um discurso populista e eleitoreiro, porque medidas de assistência por infecção pela Covid-19 e seguro estão sendo adotadas pelas empresas há muito tempo em acordo com os funcionários. Apenas burocratizaram algo que, na prática, já vem ocorrendo. É o eterno discurso do “capitalismo malvado” feito por quem passa o dia no ar-condicionado, com salário de mais de R$ 30 mil e que é sustentado pelo trabalhador que não merece ser chamado de coitadinho por parlamentares que vivem nessa realidade ficcional. Além disso, muitas dessas medidas, quando impostas pelo Estado em vez de serem fruto de acordo entre as partes que trabalham, podem acabar gerando desemprego no setor e aumento de preços para o consumidor. 

